import React from "react";
import { NavLink, Outlet, useNavigate } from "react-router-dom";
import { FaSearch, FaCheckDouble } from "react-icons/fa";
import {
  BsCheck2All,
  BsFillPeopleFill,
  BsThreeDotsVertical,
  BsFillChatLeftTextFill,
  BsFilter,
} from "react-icons/bs";

function Pages() {
  return (
    <div>
      <section className="grid grid-cols-7 w-screen h-screen bg-[#222E35]">
        <div className="col-span-2 bg-[#111B21] w-full h-screen grid grid-rows-5 border-r border-gray-600">
          {/* Profile */}
          <section className="w-full bg-[#111B21] row-span-1 grid grid-rows-2 ">
            <div className="flex justify-between bg-[#222E35] p-4 items-center">
              <div className="bg-white rounded-full w-10 h-10"></div>
              <div className="text-gray-400 flex flex-row space-x-8 text-xl">
                <button>
                  <BsFillPeopleFill />
                </button>{" "}
                <button>
                  <BsFillChatLeftTextFill />
                </button>{" "}
                <button>
                  <BsThreeDotsVertical />
                </button>{" "}
              </div>
            </div>
            {/* Search */}
            <div className="bg-[#111B21] p-2 py-2 flex flex-row justify-between space-x-6 h-fit">
              <section className="bg-[#222E35] w-full h-10 rounded-xl px-5 p-2 text-white flex-row flex items-center justify-between">
                <FaSearch className="text-gray-400" />
                <input
                  type="text"
                  className="w-[80%] bg-transparent font-light text-sm"
                  placeholder="Search or Start New Chat"
                />
              </section>
              <BsFilter className="text-gray-400 text-3xl self-center"/>
            </div>
          </section>
          {/* Contact */}
          <section className="row-span-4 h-[537px] overflow-auto p-2 py-2">
          </section>
        </div>
        <div className="col-span-3 w-full h-full">
          <Outlet />
        </div>{" "}
      </section>
    </div>
  )
}

export default Pages
